import React from "react";
// @material-ui/core components
import { makeStyles } from "@material-ui/core/styles";
// core components
import GridContainer from "components/Grid/GridContainer.js";
import GridItem from "components/Grid/GridItem.js";
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import axios from 'axios';
import { useState } from 'react';


import paul from "assets/img/paul.jpg";
import brad from "assets/img/brad.jpg";
import wes from "assets/img/wes.jpg";


import styles from "assets/jss/material-kit-react/views/componentsSections/basicsStyle.js";
import { collapseTextChangeRangesAcrossMultipleVersions } from "typescript";

const useStyles = makeStyles(styles);
let test2 = [];

export default function SectionBasics() {
  const [display, setDisplay] = useState("");
  const [testa, setTest] = useState();

  let test = [];
  let ex;
  function getTalentDetails() {
    axios
      .get('/api/profile/talent-details')
      .then((response) => {
        console.log(response.data);
        test.push(response.data)
        setTest(test[0]);
        console.log('avfvdcff');
        console.log(testa.length);
        for (let i = 0;i<testa.length;i++){
          return (
            <GridContainer>
              <GridItem xs={12} sm={12} md={4}>
                <Card className={classes.root}>
                  <CardActionArea>
                    <CardMedia
                      component="img"
                      height="140"
                      className={classes.media}
                      image={wes}
                      title=""
                    />
                    <CardContent>
                      <Typography gutterBottom variant="h5" component="h3">
                      {testa[i].talentName}
                      </Typography>
                      <Typography variant="body2" color="textSecondary" component="p">
                      {testa[i].talentName}
                      </Typography>
                    </CardContent>
                  </CardActionArea>
                </Card>
              </GridItem>
            </GridContainer>
          )
        }
        ex = test[0].map(item => { return item.talentName })
        console.log(ex);
        //console.log(test);
        //test2.map(item=>{console.log(item.talentName)})
      })
    //return ex.map((item)=> <li>{ex}</li>);
  }
  //getTalentDetails();

  function displaydata() {
    // console.log('hi');
    // let fk = getTalentDetails();
    // console.log(fk); 


    /*testa.map(item => {
      console.log('asda');
      console.log(item.talentName);
      return (
        <GridContainer>
          <GridItem xs={12} sm={12} md={4}>
            <Card className={classes.root}>
              <CardActionArea>
                <CardMedia
                  component="img"
                  height="140"
                  className={classes.media}
                  image={wes}
                  title=""
                />
                <CardContent>
                  <Typography gutterBottom variant="h5" component="h3">
                  {item.talentName}
                  </Typography>
                  <Typography variant="body2" color="textSecondary" component="p">
                  {item.talentName}
                  </Typography>
                </CardContent>
              </CardActionArea>
            </Card>
          </GridItem>
        </GridContainer>
      )
    })*/

  }




  const classes = useStyles();

  return (
    <div className={classes.sections}>
      <div className={classes.container}>
        <div className={classes.title}>
          <h4>Recommended for you</h4>
        </div>
        <GridContainer>
          <GridItem xs={12} sm={12} md={4}>
            <Card className={classes.root}>
              <CardActionArea>
                <CardMedia
                  component="img"
                  height="140"
                  className={classes.media}
                  image={paul}
                  title=""
                />
                <CardContent>
                  <Typography gutterBottom variant="h5" component="h3">
                    Paul Phua
                </Typography>
                  <Typography variant="body2" color="textSecondary" component="p">
                    Paul Phua is a professional poker player who host Triton Poker competition
                </Typography>
                </CardContent>
              </CardActionArea>
            </Card>
          </GridItem>

          <GridItem xs={12} sm={12} md={4}>
            <Card className={classes.root}>
              <CardActionArea>
                <CardMedia
                  component="img"
                  height="140"
                  className={classes.media}
                  image={brad}
                  title=""
                />
                <CardContent>
                  <Typography gutterBottom variant="h5" component="h3">
                    Brad Owen
                </Typography>
                  <Typography variant="body2" color="textSecondary" component="p">
                    Brad Owen is a professional poker player who host Triton Poker competition
                </Typography>
                </CardContent>
              </CardActionArea>
            </Card>
          </GridItem>

          <GridItem xs={12} sm={12} md={4}>
            <Card className={classes.root}>
              <CardActionArea>
                <CardMedia
                  component="img"
                  height="140"
                  className={classes.media}
                  image={wes}
                  title=""
                />
                <CardContent>
                  <Typography gutterBottom variant="h5" component="h3">
                    Wes Cutshall
                </Typography>
                  <Typography variant="body2" color="textSecondary" component="p">
                    Wes Cutshall is a professional poker player who host Triton Poker competition
                </Typography>
                </CardContent>
              </CardActionArea>
            </Card>
          </GridItem>
        </GridContainer>
        <br></br>

        <div className={classes.title}>
          <h4>Talent Details</h4>
        </div>

        {getTalentDetails()}
        {displaydata()}

        <GridContainer>
          {/* {displaydata()} */}
          <GridItem xs={12} sm={12} md={4}>
            <Card className={classes.root}>
              <CardActionArea>
                <CardMedia
                  component="img"
                  height="140"
                  className={classes.media}
                  image={wes}
                  title=""
                />
                <CardContent>
                  <Typography gutterBottom variant="h5" component="h3">
                    {display}
                  </Typography>
                  <Typography variant="body2" color="textSecondary" component="p">
                    {display}
                  </Typography>
                </CardContent>
              </CardActionArea>
            </Card>
          </GridItem>
        </GridContainer>

      </div>
    </div>
  );
}
